# 继承QTableWidget，重写鼠标滚动方法wheelEvent
class myTable(QtWidgets.QTableWidget):
    def __int__(self, parent=None):
        super(myTable, self).__init__(parent)

    def wheelEvent(self, event):
        angle = event.angleDelta() / 8   # 返回QPoint对象，为滚轮转过的数值，单位为1/8度
        angleX = angle.x()               # 水平滚过的距离(此处用不上)
        angleY = angle.y()               # 竖直滚过的距离
        if angleY > 0:                   # 鼠标向下滚动时
            self.scrollToLeft()
        else:                            # 鼠标向上滚动时
            self.scrollToRight()

    def scrollToLeft(self):              # 滚动条向右移动
        a = self.horizontalScrollBar().value()      # 获取滚动条当前位置
        a -= 63
        self.horizontalScrollBar().setValue(a)      # 设置滚动条位置

    def scrollToRight(self):              # 滚动条向左移动
        a = self.horizontalScrollBar().value()      # 获取滚动条当前位置
        a += 63
        self.horizontalScrollBar().setValue(a)      # 设置滚动条位置